import './App.css';
import React, { useEffect, useState } from 'react';

function App() {
  const [gridData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const apiUrl = 'https://localhost:7095/api/hello?width=6&height=6';
        const response = await fetch(apiUrl);

        if (response.ok) {
          const data = await response.json();
          return data;
        } else {
          console.error(`HTTP error! Status: ${response.status}`);
        }
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData(); // Call the fetchData function directly in useEffect

  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Mine Game</h1>
      </header>
      <div className="App-body">
        <p id="grid">
          {gridData}
        </p>
      </div>
    </div>
  );
}

export default App;
